import React from 'react';
import logo from './logo.svg';
import './App.css';
import {Component} from 'react';

class App extends Component{
    constructor(){
        super();
        this.state = {
            // String: 'Hello Uuma'
            monsters: [
                {
                    name: 'Uuma'
                },
                {
                    name: 'Dracula'
                },
                {
                    name: 'John'
                },
                {
                    name: 'Zombie'
                }
            ]
        }
    }
    render(){
        return ( 
            <div className="App">
                <h1>{this.state.String}</h1>
            </div>
        );
    }
}

export default App;
